import React, { useRef } from "react";
import {OrbitControls, useGLTF} from "@react-three/drei";

export function Model(props) {
  const { nodes, materials } = useGLTF("/old-monitor.gltf");
  return (
      <OrbitControls>
          <group {...props} dispose={null}>
              <mesh
                  geometry={nodes.Cube_BakedPCBody_0.geometry}
                  material={materials.BakedPCBody}
                  position={[-0.011, 1.814, 3.722]}
                  rotation={[-Math.PI / 2, 0, 0]}
                  scale={1.991}
              />
              <mesh
                  geometry={nodes.Cube_BakedScreen_0.geometry}
                  material={materials.BakedScreen}
                  position={[-0.008, -0.015, 3.774]}
                  rotation={[-Math.PI / 2, 0, 0]}
                  scale={1.991}
              />
          </group>
      </OrbitControls>
  );
}

